    /**
     * Convert a string representation of an icon to a 
     * ByteBuffer.
     * @param img - The string icon to be converted
     * @return The converted String image
     */
    private static ByteBuffer convert(String img) {
        // Setup string data
        String[] raw = img.split("/");
        byte[] bytes = new byte[raw.length];
        // Parse raw data
        for(int i=0;i<raw.length;i++)
            bytes[i] = (byte) Byte.parseByte(raw[i]);
        // Return new image
        return ByteBuffer.wrap(bytes);
    }
